import React from "react";
import {Route, BrowserRouter } from "react-router-dom";
import StateTest from "./state/stateTest";

function Routes() {
    return(
        <BrowserRouter>
            <RouteWithLayout
                component={StateTest}
                layout="/stateTest"
            />
        </BrowserRouter>
    )
}

export default Routes;
